import "./index.css";
import {add,sub,mult,divi} from "./Calculation";
var col=[{color:'orange ',},{color:'red ',},{color:'blue',},{color:'green ',}];
function App(prop){
    return(<>
    <ul className="rm">
        <li style={col[0]}>{prop.nbr} Sum of two no is = {add(-12,22)}</li>
        <li style={col[1]}>{prop.nbr} Sub of two no is = {sub(12,2)}</li>
        <li style={col[2]}>{prop.nbr} ult of two no is = {mult(5,2)}</li>
        <li style={col[3]}>{prop.nbr} Div of two no is = {divi(50,5)}</li>
    </ul>
    </>)
}
export default App;
